Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('MR12','Requalifying Wages - Double Dip Not Met - Indefinite','INIE','An individual who has received unemployment benefits on a previous claim is required to work and receive at least $2000 in employment as defined in section 8-70-113 in order to qualify for benefits on their next claim.  ','N',null,'You have not received at least $2000 for such work since you filed your previous claim.  Therefore, you do not qualify for benefits.  When you have worked and received at least $2000 as defined above, and are once again unemployed, call 303-318-9000 (Denver metro area) or 1-800-388-5515 (outside Denver metro area or Colorado) to reopen this claim.  Your claim is disallowed from [Issue Start Date] through [Issue End Date].  ','Colorado Employment Security Act: 8-73-107 (2)','N   ','N   ','N','N','WEEK','CLMT','N',null,to_date('15-APR-19 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('15-APR-19 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','N','C',null,null);
