Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('TR73','Payment Denied Missing Benchmark','IEND','In order to receive TRA, once you have started an approved training program, you must be participating in the TAA approved training and making satisfactory progress in your training additionally you must provide your workforce center councilor documentation from the school verifying your academic progress.  Information has been received in the TRA office indicating that you have failed to provide benchmark information to your councilor and as a result are no longer meeting your requirements for TAA approved training. You will not be able to receive further TRA payments until you provide benchmark information that is up to date.','Y','Benchmark information for [Enter Time Period Here] must be received by the TRA office for you to receive continuing payments.','Payment for the weeks [Issue Start Date] through [Issue End Date] was not issued to you because you are not meeting the requirements to receive payment.  Please call the TRA office at 303-318-8940 or 1-888-641-9106 (outside the Denver Metro Area) if you have any questions. ','Code of Federal Regulations, Title 20 part 617 and PL 114-27','N   ','N   ','N','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','N','C',null,null);
