Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('MR23','Wages added','ELGB','We have received a request to investigate the wages earned on this claim. Our findings show that this disbursing company operated as a third-party administrator for the employer distributing payments as a result of a disability or illness. Payments that are within six months from the last month of employment are considered wages. It is determined the payments are covered employment and the base-period wages will be included in the calculation of the claimant''s unemployment insurance benefits. 
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('MR24','Wages added','ELGB','We have received a request to investigate your employment status with this entity. After investigation it has been determined that you were not free from control and direction in the performance of the service or you were not customarily engaged in an independent trade, occupation, profession, or business related to the service. The relationship is not that of an independent contractor and is determined to be covered employment. The employer is responsible for payment of unemployment insurance premiums.','N',null,'If determined to be monetarily entitled you may receive benefits based on base period wages paid by this employer, and your maximum benefits payable may be increased by the amount of wages paid by this employer on this and any future claim.','Colorado Employment Security Act: 8-70-115','N   ','N   ','N','N',null,'BOTH','BASE',null,to_date('15-APR-19 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('15-APR-19 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','E','E',null,null);
