Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('MR26','Wages added - Not insurance sales person','ELGB','We have received a request to investigate your employment as an insurance salesperson. After investigation, our findings show that you are not an insurance salesperson who receives only commission on insurance sales. It has been determined the work was covered employment and the base period wages will be included in the calculation of your unemployment benefits.','N',null,'If determined to be monetarily entitled you may receive benefits based on base period wages paid by this employer, and your maximum benefits payable may be increased by the amount of wages paid by this employer on this and any future claim.','Colorado Employment Security Act: 8-70-139','N   ','N   ','N','N',null,'BOTH','BASE',null,to_date('15-APR-19 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('15-APR-19 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','E','E',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('MR27','Wages NOT added','IIND','We have received a request to investigate your employment as an insurance agent or an insurance solicitor. After investigation, our findings show that you are an insurance agent or solicitor who receives earnings based solely on commission of insurance sales. Therefore, you are exempt from coverage for unemployment benefits.','N',null,'You will not receive benefits based on wages paid by this employer.','Colorado Employment Security Act: 8-70-139','N   ','N   ','N','N',null,'BOTH','BASE',null,to_date('15-APR-19 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('15-APR-19 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','C','C',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('D273','Ineligible - Refusal to Accept Shift Change','IELG','Based on information received, our investigation has determined that you were discharged for refusing to work a different shift.  The change in shifts did not violate your seniority rights.  It is determined that you are responsible for the separation and a disqualification is being imposed.','N',null,'This employer did not pay into your claim.  The employer was the last employer for whom you worked before you signed up for unemployment.  By law, we have to look at why you no longer work there.
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('D274','Ineligible - Refusal to Accept Shift Change','INRU','Based on information received, our investigation has determined that you were discharged for refusing to work a different shift.  The change in shifts did not violate your seniority rights.  It is determined that you are responsible for the separation and a disqualification is being imposed.','N',null,'By law, we cannot pay you benefits based on the wages you earned from this employer.  We must remove the money for those benefits from your claim.  
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('D275','Eligible - Refusal to Work Overtime, Personal Reasons','ELGB','Based on information received, our investigation has determined that you were discharged after refusing to work overtime. Information in the record indicates that you had reasonable, compelling personal reasons for refusing and were not given sufficient advance notice.  It is determined that you are entitled to benefits based on this employment provided you continue to meet all eligibility requirements of the unemployment insurance law.','N',null,' We can pay you the benefits based on the wages you earned from this employer.  You must continue to meet all the weekly requirements listed in the claimant handbook.','Colorado Employment Security Act: 8-73-108 (4)(k)','N   ','N   ','Y','Y','Y   ','BOTH','Y',null,to_date('17-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('17-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','20','Y','E',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('D276','Ineligible - Left Job Site Before End of Shift','INRU','Based on information received, our investigation has determined that you were discharged for leaving the job before the end of the shift.  You did not have your employer''s permission to leave.  It is determined that you are responsible for the separation and a disqualification is being imposed.','N',null,'By law, we cannot pay you benefits based on the wages you earned from this employer.  We must remove the money for those benefits from your claim. We might be able to pay you benefits based on wages you earned from other employers, if any.  The amount of money you have left when we mailed this decision is $&totposs.','Colorado Employment Security Act: 8-73-108 (5)(e)(XVIII)','N   ','N   ','Y','N','WEEK','BOTH','BASE',null,to_date('17-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('17-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','20','Y','C',null,null);
