Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('TR57','OBA no Training','IEND','While you are receiving TRA with a waiver, you can work part time and earn up to 25% weekly benefit amount before we have to offset your weekly benefit amount with your earnings. Any earnings you receive in excess of 25% of your weekly benefit amount will be deducted on a dollar for dollar basis from your weekly TRA benefit amount. If you earn more than your weekly benefit amount, payment for that week will be denied.During the week(s) listed below you earned more than your weekly benefit amount.','Y','During the week ending [Enter Date Here] you reported that you worked [Enter number of Hours Here] hours and earned $[Enter Dollar Amount Here]. ','That dollar amount exceeds your weekly benefit amount. As a result, you are not eligible to receive TRA benefits for the week ending [Issue End Date].Please call the TRA office at 303-318-8940 or 1-888-641-9106 (outside the Denver Metro Area) if you have any questions. ','Code of Federal Regulations, Title 20 part 617 and PL 114-27','N   ','N   ','N','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','N','C',null,null);
