Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('AA38','Ineligible Indefinitely - Seeking Part-Time vs. Full-Time','INIE','A person must be able, available and actively seeking suitable work during any period for which benefits are claimed or received.  It has been determined that your previous work was full-time and you are now seeking part-time work (reg 2.2.2).  You are restricting your availability for suitable employment. ','N',null,'Payments cannot be made because you do not meet the eligibility requirements of the law.  When you begin to seek full-time work, if unemployed, call 303-318-9000 (Denver metro area) or 1-800-388-5515 (outside Denver metro area or Colorado). Your claim is disallowed from [Issue Start Date] to [BYE].','Colorado Employment Security Act: 8-73-107 (1)(c)(I)','N   ','N   ','Y','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','30','Y','C',null,null);
