Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('TR06','Ineligible - Additional TRA eligibility period expired (2009 and after)','IEND','The eligibility period for your Additional TRA benefits has now expired.','Y','Please insert the following:  You eligibility period for Basic TRA benefits was [#] weeks starting week ending mm/dd/yyyy.  Your last payable week for Basic TRA benefit was week ending mm/dd/yyyy.','Therefore, you are no longer eligible to receive Additional TRA benefits.Please call the TRA office at 303-318-8940 or 1-888-641-9106 (outside the Denver Metro Area) if you have any questions. ','Code of Federal Regulations, Title 20, Part 617.15 (b) and Public Law 114-27.','N   ','N   ','N','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','N','C',null,null);
