Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('TR23','Ineligible - Enrollment Unavailable waiver expired','INIE','You were granted an Enrollment Unavailable waiver because you were unable to enroll in TAA approved full-time training within the deadline.','Y','Please insert the following:  This waiver was granted from mm/dd/yyyy through mm/dd/yyyy and has now expired.','Therefore you are not eligible to receive Basic TRA benefits from [Issue Start Date] and until such time as you begin attending TAA approved full-time training or are granted another waiver for reasons other than extenuating circumstances.Please call the TRA office at 303-318-8940 or 1-888-641-9106 (outside the Denver Metro Area) if you have any questions. ','Code of Federal Regulations, Title 20 part 617.19(a)(1)(ii) and Public Law 114-27.','N   ','N   ','N','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','N','C',null,null);
