Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('D261','Ineligible - Off-The-Job Use of Controlled Substances','INRU','Based on information received, our investigation has determined that you separated because of your off-the-job use of not medically prescribed controlled substances which adversely affected your job performance.  It is determined you are responsible for the separation and a disqualification is being imposed.','N',null,'By law, we cannot pay you benefits based on the wages you earned from this employer.  We must remove the money for those benefits from your claim. We might be able to pay you benefits based on wages you earned from other employers, if any.  The amount of money you have left when we mailed this decision is $&totposs.','Colorado Employment Security Act: 8-73-108 (5)(e)(IX)','N   ','N   ','Y','N','WEEK','BOTH','BASE',null,to_date('17-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('17-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','20','Y','C',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('Q253','Ineligible - Wages Paid Properly','INRU','Based on information received, our investigation has determined that you quit this employment because you were dissatisfied with standard working conditions.  The working conditions were normal for this type of work and were not harmful to your well-being.  It is determined you are responsible for the separation and a disqualification is being imposed.','N',null,'By law, we cannot pay you benefits based on the wages you earned from this employer.  We must remove the money for those benefits from your claim. This employer was the last employer for whom you worked before you signed up for unemployment.  Also by law, we cannot pay you any benefits for ten weeks. You will not receive any money from us from [Issue Start Date] through [Issue End Date].  We might be able to pay you benefits based on wages you earned from other employers, if any, after that time. The amount of money you have left when we mailed this decision is [$&totposs].','Colorado Employment Security Act: 8-73-108 (5)(e)(I)','N   ','N   ','Y','N','WEEK','BOTH','BALA',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','10','Y','C',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('AT04','Ineligible Indefinitely - Approved Training; Not Approved, but not available to work','INIE','Your request, that the division approve your training program, has been denied.  As a result, you must be available for work and you must actively seek work in order to be eligible for unemployment insurance benefits. It is determined that you are not available for work because you are attending school or training during your normal working hours.','N',null,'Benefits will not be paid while you are attending school or training.  When this condition no longer exists and you are unemployed, call 303-318-9000 (Denver metro area) or 1-800-388-5515 (outside Denver metro area or Colorado) to reopen your claim. Your claim is disallowed from [Issue Start Date} to [BYE].','Colorado Employment Security Act: 8-73-107 (4)(a) and 8-73-107 (1)(c)(I)','N   ','N   ','Y','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','30','N','C',null,null);
