Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('AA15','BPC ONLY: Eligible - Incarceration with approved work release','ELGB','A person must be able and available for suitable work during any period for which benefits are claimed or received. Information received establishes that you are incarcerated with approved work release.  Therefore, you are considered available to seek and accept suitable work.','Y','Please insert the following:  It has been established that the incarceration is for a period of time prior to the effective date of the claim and the claimant continues to be able, available and actively seeking employment.','Your claim is allowed provided that you meet the eligibility requirements of the law. If your work release status changes, you will no longer be able and available for work and you must stop requesting benefits.  When you are no longer incarcerated and you are able and available for work, call 303-318-9035 (Denver metro area) or 1-877-464-4622 (outside Denver metro area or Colorado).','Colorado Employment Security Act: 8-73-107 (1)(c)(I)','N   ','N   ','N','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','30','Y','N',null,null);
