Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('PE06','Ineligible - Lump Sum - Separation Due To Retirement','IELG','You received [dollars] as a distribution from a retirement plan that was contributed to by the above employer and reinvested it in an individual retirement account or Keogh plan.  ','N',null,'However, because the reason for separation was due to retirement, the distribution affects your claim by postponing benefits for the number of weeks that is equal to the total of the payment divided by your last full-time weekly wage from this employer.  Therefore, you cannot be paid benefits from [Issue Start Date] through [Issue End Date].  ','Colorado Employment Security Act: 8-73-110 (3)(a)','N   ','N   ','Y','N','WEEK','BOTH','Y',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','50','Y','C',null,null);
