Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('FE05','PEUC - Job Refusal Requalification','IELG','You have worked at least four (4) weeks and have earned at least four (4) times your weekly benefit amount. Therefore, the disallowance for refusing either a referral to or an offer of suitable work has been reduced and you are entitled to receive Pandemic Emergency Unemployment Compensation (PEUC) provided that you continue to meet all eligibility requirements of the law. ','N',null,'Your claim is disallowed from [issue start date] to [issue end date]. ','Colorado Employment Security Act 8-75-103.5 & 20 CFR 615.8(F)','N   ','N   ','N','N','WEEK','CLMT','N',null,to_date('13-SEP-18 12:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',to_date('13-SEP-18 12:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',0,null,'NA','N','NA','N','C',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('CS06','Seasonal wages only payable during season','IEND','We have received a request to determine if your employment with the employer is seasonal. The division uses wages based on seasonal employment in calculating the amount of weekly benefit amount and the maximum benefits payable. However, benefits paid based on seasonal employment wages are only payable during the designated seasonal period for that employment. After investigation, the deputy determined that your employment with the employer was seasonal. ','Y','Please insert the following: The seasonal dates for this employer are xx/xx/xxxx to xx/xx/xxxx','Thus, the division may only pay benefits based on this employment during the seasonal period listed above.','Colorado Employment Security Act: 8-73-106','N   ','N   ','Y','N',null,'BOTH','BALA',null,to_date('11-JUL-19 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('11-JUL-19 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','84','Y','C',null,null);
