Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('EX03','SEB - Now Eligible, Requalified from prior DQ for Work Search','IELG','We had stopped paying State Extended Benefits because you did not look for work as required. By law, we can pay you benefits again if you go back to work in each of four weeks; earn at least four times the amount we pay you every week; and not be responsible for not working there any more. You have shown us that you have met those requirements.','N',null,'We can pay you State Extended Benefits again. You are denied SEB benefits beginning [issue start date] until [issue end date].','8-75-103.5 ','N   ','N   ','Y','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',0,null,'NA','N','NA','N','C',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('EX05','SEB - state where claimant lives is not triggered on','INIE','By law, we can pay you Colorado State Extended Benefits only if the state where you live is paying State Extended Benefits. The state where you live is not paying State Extended Benefits. ','N',null,'We can pay you two weeks of Colorado State Extended Benefits. We cannot pay you State extended Benefits beginning [issue start date]. Note: The state where you live may be paying their State Extended Benefits. If that happens, we can beginning paying you Colorado State Extended Benefits from that time. You may choose to continue to request payment in case that happens. We might be able to pay you for the weeks you request. You may be eligible to collect Pandemic Unemployment Assistance (PUA) if you are unemployed as a result of COVID-19 for the duration of your disqualification. Please contact 303-318-9000 to file a PUA claim.','8-75-103 (c)','N   ','N   ','N','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',0,null,'NA','N','NA','N','C',null,null);
