Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('EX08','SEB - Ineligible, can file a regular UI claim','INIE','You may have enough wages for a new claim for Unemployment Benefits.','Y','Please insert the following:  You have wages in [enter state(s) name].','If you have wages in Colorado, go to www.coloradoui.gov and select New Claimant to file a new regular unemployment insurance claim. If you have wages in another state please contact that state to file a new regular unemployment insurance claim. We cannot pay you State Extended Benefits from [issue start date] through [issue end date].','8-75-101 (2) (a) III','N   ','N   ','Y','N','WEEK','CLMT','Y',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',0,null,'NA','N','NA','N','C',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('D204','Ineligible - Violation of Employer Rule or Policy Damage to Employer''s Interests','INRU','Based on information received, our investigation has determined that you were discharged for violating a company rule.  This violation resulted or could have resulted in serious damage to the employer''s interests. It is determined that you are responsible for the separation and a disqualification is being imposed.','N',null,'By law, we cannot pay you benefits based on the wages you earned from this employer.  We must remove the money for those benefits from your claim. We might be able to pay you benefits based on wages you earned from other employers, if any.  The amount of money you have left when we mailed this decision is $&totposs.','Colorado Employment Security Act: 8-73-108 (5)(e)(VII)','N   ','N   ','Y','n','WEEK','BOTH','BASE',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','20','Y','C',null,null);
