Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('D206','Ineligible - Violation of Employer Rule or Policy Damage to Employer''s Interests','INRU','Based on information received, our investigation has determined that you were discharged for violating a company rule.  This violation resulted or could have resulted in serious damage to the employer''s interests. It is determined that you are responsible for the separation and a disqualification is being imposed.','N',null,'By law, we cannot pay you benefits based on the wages you earned from this employer.  We must remove the money for those benefits from your claim.  This employer was the last employer for whom you worked before you signed up for unemployment.  Also by law, we cannot pay you any benefits for ten weeks.  You will not receive any money from us from [Issue Start Date] through [Issue End Date].  We might be able to pay you benefits based on wages you earned from other employers, if any, after that time. The amount of money you have left when we mailed this decision is $&totposs.','Colorado Employment Security Act: 8-73-108 (5)(e)(VII)','N   ','N   ','Y','n','WEEK','BOTH','BALA',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','20','Y','C',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('M016','Ineligible - RESEA, Work Search Not Substantiated','IELG','A person must be able, available and actively seeking work during any period in which benefits are claimed or received.  During your recent reemployment, eligibility and assessment appointment, you were required to provide details of your work search activities.  You have failed to provide the required documentation to substantiate your required work search activities.  ','Y','Please insert the following:  The week(s) affected by this decision are [xx/xx/xx].','Payment cannot be made for the week(s) indicated below because you do not meet the eligibility requirements of the law. Your claim is disallowed from [Issue Start Date] through [Issue End Date].  ','Colorado Employment Security Act: 8-73-107 (1)(g) & Regulation 2.8.4.0','N   ','N   ','Y','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','73','Y','C',null,null);
