Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('K004','Compensable week(s) -a knowing failure - fraud','IELG','The overpayment is the result of your failure to furnish accurate information concerning material facts in regard to your claim for unemployment benefits. The material facts resulting in a determination that you were not in total or partial unemployment.','N',null,'Whoever collects unemployment benefits due to false statements or failure to disclose a material fact shall be liable to repay the benefits and a penalty of 65 percent of that amount. In addition, you may be disqualified for 4  otherwise compensable weeks for each such week of payments received fraudulently. Accordingly, you are disqualified from receiving payments for [# of compensable weeks] weeks.  You will not receive benefits if otherwise eligible until you serve the penalty weeks and pay back the overpayment in full.','Colorado Employment Security Act: 8-81-101 (4)(a)(II)','N   ','N   ','N','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','N','C',null,null);
