Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('D151','Eligible - On-The-Job Use of Controlled Substances','ELGB','Based on information received, our investigation has determined that you separated because of your use of not medically prescribed controlled substances while on the job.  You have satisfactorily addressed the problem as required by the health provisions of the law. ','N',null,' We can pay you the benefits based on the wages you earned from this employer.  You must continue to meet all the weekly requirements listed in the claimant handbook.','Colorado Employment Security Act: 8-73-108 (4)(b)(IV)
