Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('EX11','SEB - Not Eligible due to not being eligible for regular UI benefits (because of base period ER DQ)','INIE','You were disqualified from receipt of all regular unemployment benefits because of multiple disqualifying decisions. ','N',null,'You are therefore not entitled to receive State Extended Benefits. Your claim is disallowed beginning [issue start date]. If you disagree with this decision, you must appeal the decision(s) that resulted in the original disqualifications on your regular unemployment insurance benefits claim. You may be eligible to collect Pandemic Unemployment Assistance if you are unemployed as a result of COVID-19 for the duration of your disqualification. Please visit www.coloradoui.gov for more information','8-75-103.5(8) & 20 CFR 615.8(a)','N   ','N   ','Y','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',0,null,'NA','N','NA','N','C',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('EX12','SEB - Eligible, Did not refuse a job','ELGB','A person getting State Extended Benefits cannot refuse to follow a lead for a job or refuse a job that he or she can do. You did not refuse to follow a lead for a job or refuse a job.','N',null,'We can still pay you State Extended Benefits. ','8-75-103.5','N   ','N   ','Y','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',0,null,'NA','N','NA','N','N',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('EX13','SEB - Ineligible, Did refuse a job','INIE','A person getting State Extended Benefits cannot refuse to follow a lead for a job or refuse a job that he or she can do. You refused to follow a lead for a job or you refused a job.','N',null,'We cannot pay you State Extended Benefits beginning [issue start date]. By law, we can pay you benefits again if you go back to work in each of four weeks; earn at least four times the amount we pay you every week; and not be responsible for not working there any more. Call us if you meet the work requirements in the last paragraph. Call 303-318-9000 (Denver metro area) or 1-800-388-5515 (outside Denver metro area). You may be eligible to collect Pandemic Unemployment Assistance if you are unemployed as a result of COVID-19 for the duration of your disqualification. Please visit www.coloradoui.gov for more information.','8-75-103.5','N   ','N   ','N','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',0,null,'NA','N','NA','N','C',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('EX14','SEB - Now Eligible, Requalified from prior DQ for Job Refusal','IELG','We had stopped paying you State Extended Benefits because you refused to follow a lead for a job or you refused a job. By law, we can pay you benefits again if you go back to work in each of four weeks; earn at least four times the amount we pay you every week; and not be responsible for not working there any more. You have met those requirements.','N',null,'We can pay you State Extended Benefits again. You are denied SEB benefits beginning [issue start date] until [issue end date].','8-75-103.5','N   ','N   ','N','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'himaparihar',0,null,'NA','N','NA','N','C',null,null);
