Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('D064','Eligible - Domestic Violence Incident Outside Work','ELGB','This employer fired you believing you violated a law or ordinance which had, or could have had, a detrimental effect to the employer''s property or interests.  We have considered all the information given by the employer and by you.  We determined you did not act as the employer believed.  You are not at fault for this separation.  ','N',null,'We can pay you the benefits based on the wages you earned from this employer as long as you continue to meet all the weekly requirements listed in the claimant handbook.','Colorado Employment Security Act: 8-73-108 (4)','N   ','N   ','Y','Y','WEEK','BOTH','Y',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','20','Y','E',null,null);
