Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('D237','Ineligible - Violation of Employer Rule or Policy - Endangered Others','INRU','Based on information received, our investigation has determined that you were discharged after you violated a company rule.  Your actions placed or could have placed you and/or others in physical danger. It is determined you are responsible for the separation and a disqualification is being imposed.','N',null,'By law, we cannot pay you benefits based on the wages you earned from this employer.  We must remove the money for those benefits from your claim. We might be able to pay you benefits based on wages you earned from other employers, if any.  The amount of money you have left when we mailed this decision is $&totposs.','Colorado Employment Security Act: 8-73-108 (5)(e)(VII)','N   ','N   ','Y','n','WEEK','BOTH','BASE',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','20','Y','C',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('WA11','BPC Only: InEligible - Non Fraud Waiver Denied - Offset Only','IIND','Your request for waiver of the overpayment has been denied as you do not meet the criteria for a waiver.','N',null,'Although your overpayment waiver request has been denied, due to your current financial situation, the division agrees that recouping the overpaid amount will only occur by offsetting the claimant''s benefits for repayment, if and when you file for benefits. No other collection activity will ever occur on your balance due until you file a claim and become eligible for benefits at which point the amount of $[OP Balance] will again become due and payable. If you are filing for benefits at that time, we will offset each benefit payment until repaid. If you are unable to make the full payment at that time, contact benefit payment control at 303-318-9035 or 1-877-464-4622.
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('LD05','Eligible - Offensively Locked Out','ELGB','You became unemployed because of a lock-out by your employer.  It is determined your employer was participating as a partner in negotiations, not as a member of a multi-employer bargaining unit.  Union contracts involved in the negotiations were opened separately rather than jointly.  Your employer did not bind himself to the bargaining results.  Since this is not a multi-employer bargaining arrangement, the lockout does not constitute a labor dispute.  ','N',null,'You are entitled to benefits based on this employment provided you continue to meet all eligibility requirements of the unemployment insurance law.   ','Colorado Employment Security Act: 8-73-109 (1)','N   ','N   ','N','Y','WEEK','BOTH','Y',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','N','E',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('LD06','Ineligible - Defensively Locked Out','IELG','You became unemployed due to a strike that resulted in a defensive lockout by the employer.  You are in the same grade or class of workers conducting the strike. ','N',null,'You are not eligible for unemployment benefits until the strike has been resolved.  Additionally, you are ineligible for the period of time that is necessary for the employer to resume normal operations.  An award of benefits may be granted, at that time, if you are otherwise eligible. Your claim is disallowed from [Issue Start Date] through [Issue End Date].  ','Colorado Employment Security Act: 8-73-109 (1)','N   ','N   ','N','N','WEEK','BOTH','Y',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','N','C',null,null);
