Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('D216','Ineligible - Careless or Shoddy Work','INRU','Based on information received, our investigation has determined that you were discharged for doing your work in a careless or shoddy manner. You were capable of doing the job correctly.  It is determined that you are responsible for the separation and a disqualification is being imposed.','N',null,'By law, we cannot pay you benefits based on the wages you earned from this employer.  We must remove the money for those benefits from your claim. We might be able to pay you benefits based on wages you earned from other employers, if any.  The amount of money you have left when we mailed this decision is $&totposs.','Colorado Employment Security Act: 8-73-108 (5)(e)(XV)','N   ','N   ','Y','N','WEEK','BOTH','BASE',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','20','Y','C',null,null);
