Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('WC01','Backdated Base Period','ELGB','You separated from employment due to an accident or injury for which you received temporary total disability benefits under the workers'' Compensation act. You filed your claim for unemployment benefits within four weeks after being notified of the termination of your temporary total disability benefits. ','N',null,'Your claim is being established using the base period which was in effect at the time of separation from the employment which resulted in your temporary total disability.  In order to be eligible for payment for any week(s) under this section, the week(s) claimed must occur within three years after the date of the above mentioned separation from employment. All weeks within your benefit year fall within three years after your separation from employment. Therefore, no disallowance is being imposed.     ','Colorado Employment Security Act: 8-73-112','N   ','N   ','N','N','WEEK','CLMT','N',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','N','N',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('WC02','Backdated Base Period & Some Weeks In Benefit Year Are Beyond the Three-Year Cutoff Date','IELG','You separated from employment due to an accident or injury for which you received temporary total disability benefits under the workers'' Compensation act. You filed your claim for unemployment benefits within four weeks after being notified of the termination of your temporary total disability benefits. ','N',null,'Your claim is being established using the base period which was in effect on the date of separation from the employment which resulted in your temporary total disability.  In order to be eligible for payment for any week(s) under this section, the week(s) claimed must occur within three years after the date of the separation from employment that resulted from the accident or injury.  You are not eligible to receive benefits for weeks that occur beyond the three years.  Therefore, a disallowance is being imposed. Your claim is disallowed from [Issue Start Date] through [Issue End Date].  ','Colorado Employment Security Act: 8-73-112','N   ','N   ','N','N','WEEK','CLMT','Y',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','N','C',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('WC03','Denied Backdated Base Period - Claim Filed More Than Three Years After Separation Resulting in TTD','IEND','You separated from employment due to an accident or injury for which you received temporary total disability benefits under the workers'' Compensation act. You filed your claim for unemployment benefits more than three years after the separation from employment which resulted in your temporary total disability. ','N',null,'You are not eligible for the benefits which were available and in effect at the time of your separation from employment.  Your claim for unemployment benefits will be established using the current base period.  ','Colorado Employment Security Act: 8-73-112','N   ','N   ','N','N','WEEK','CLMT','Y',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','N','C',null,null);
Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('Q139','Ineligible - Quit Prior to Lay Off','IELG','Based on information received, our investigation has determined that you quit in anticipation of a lay-off.  You could have continued working until the time of your lay-off. It is determined you are responsible for the separation and a disqualification is being imposed. ','N',null,'This employer did not pay into your claim.  The employer was the last employer for whom you worked before you signed up for unemployment.  By law, we have to look at why you no longer work there. Also by law, we cannot pay you any benefits for ten weeks.  You will not receive any money from us from [Issue Start Date] through [Issue End Date].  We might be able to pay you benefits based on wages you earned from other employers, if any, after that time.','Colorado Employment Security Act: 8-73-108 (5)(e)(XXII)','N   ','N   ','Y','N','WEEK','BOTH','LAST',null,to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('13-SEP-18 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','Y','10','Y','C',null,null);
