Insert into UI_RATIONALE_MSTR (RATIONALE_CD,RSN_SHRT_VRSN,DECISION_CD,RSN_LNG_VRSN,ADDL_FIND_IN,ADDL_FIND_TXT,EFF_ON_CLAIMANT,STATE_UI_STATUTE,APPL_INFO_LTR_CD,EMPR_INFO_LTR_CD,WORK_LOAD_COUNT_IN,EMPR_CHRG_IN,WK_DAY_DLLR_DENIED_CD,SEND_TO_ENTITY_CD,INTERESTED_PARTY_IN,TYPE_CD,CREATE_DT,CREATE_USER,MDFCTN_DT,MDFCTN_USER,UPDATE_NU,CONSTRUCTIVE_DED_IN,APPEAL_SITU_CODE,BTQ_IN,BTQ_CATEG_CD,QC_IN,FINAL_ADVERSITY_IN,ONLINE_APPEAL_ALLOWED,POO_FUND_CHRG_ACT_ID) values ('MR41','Wages NOT added','IIND','We have received a request to investigate your employment as a railroad worker. After investigation, our findings show that you were employed by a railroad. You may be covered by the railroad retirement act if you meet their requirements. You can not receive Colorado unemployment insurance benefits based on railroad earnings.','N',null,'You will not receive benefits based on wages paid by this employer.','Colorado Employment Security Act: 8-70-134','N   ','N   ','N','N',null,'BOTH','BASE',null,to_date('15-APR-19 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',to_date('15-APR-19 00:00:00','DD-MON-RR HH24:MI:SS'),'anuragsharma',0,null,'NA','N','NA','C','C',null,null);
